import React from 'react';
import { Box, Typography} from '@mui/material'

import Header from 'src/components/Header'
import CompanyDetails from 'src/components/CompanyInfo/CompanyTable'
import Company from 'src/components/CompanyInfo/CompanyDetails';

import axios from "../../../utils/axios";

const CompanyInfoView = () => {

  return (
    <Box>
      <Header>
        업체정보
      </Header>

      <Box sx={{ width: "100%", minWidth: "440px" }}>
        <Box sx={{ display: "flex", alignItems: "center" }}>
          <SearchField />
        </Box>
        <Typography
          sx={{ fontWeight: 600, fontSize: "12px", mt: "19px", mb: "10px" }}
        >
          총 업체(0)
        </Typography>
        <Box sx={{ display: "flex" }}>
          <CompanyListTable />
          <Company />
        </Box>
      </Box>
    </Box>

  );
}

export default CompanyInfoView;
